INSERT [dbo].[Detays] ([DetayID], [urunad], [urunbilgi]) VALUES (1, N'Buzdolab', N'Buzdolab; buhar sktrma yntemiyle alan, gdalarn souk tutularak uzun zaman muhafaza edilmesini salayan soutma makinesidir.

